import React from 'react';
import '../styles/Expedition.css';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import {EXPEDITION_PATH} from "../constants/routes";
import Spinner from "react-bootstrap/Spinner";

class Expedition extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            enemyData: {},
            isLoading: true,
        }
    }

    componentDidMount() {
        this.props.sendGetRequest(EXPEDITION_PATH)
            .then((response) => {
                this.setState({enemyData: response['data']['enemy']});
                // this.setState({isLoading: false});
            }).catch((error) => {
                console.log(error.response);
        })
    }

    render() {
        if (this.state.isLoading) {
            return (
                <div>
                    <Container fluid>
                        <Row>
                            <Col xs={{order: 0}}>
                                <p> Expedition Lorem Ipsum </p>
                            </Col>
                        </Row>
                    </Container>
                </div>
            );
        } else {
            return <Spinner  animation="primary"/>
        }
    }
}

export default Expedition;
